const navBarData = [
	{
		"type": "Stays",
		"icon": "fa-bed",
		"active": true
	},
	{
		"type": "Flights",
		"icon": "fa-plane",
		"active": false
	},
	{
		"type": "Car rentals",
		"icon": "fa-car",
		"active": false
	},
	{
		"type": "Attractions",
		"icon": "fa-bed",
		"active": false
	},
	{
		"type": "Airport taxis",
		"icon": "fa-taxi",
		"active": false
	}
]

function NavBar() {


	return (
		<div>
			<div>
				Booking Website
			</div>
			<button>Register</button>
			<button>Login</button>
			<ul>
				{navBarData.map(item => (
					<li>
            <i className={item}></i>
					</li>
				))}
			</ul>
		</div>
	)
}

export default NavBar
